	ID INT IDENTITY(1,1) NOT NULL,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	Email VARCHAR(50),
	Gender VARCHAR(50),
	IpAddress VARCHAR(20),
	CreatedDate DATETIME,
	LastModifiedDate DATETIME
);
